<style>html {
  -ms-touch-action: none;
}

body, canvas, div {
  display: block;
  outline: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);

  user-select: none;
  -moz-user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -khtml-user-select: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

/* Remove spin of input type number */
input::-webkit-outer-spin-button,
input::-webkit-inner-spin-button {
  /* display: none; <- Crashes Chrome on hover */
  -webkit-appearance: none;
  margin: 0; /* <-- Apparently some margin are still there even though it's hidden */
}

body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;
  border: 0;
  margin: 0;

  cursor: default;
  color: #888;
  background-color: #333;

  text-align: center;
  font-family: Helvetica, Verdana, Arial, sans-serif;

  display: flex;
  flex-direction: column;
  
  /* fix bug: https://github.com/cocos-creator/2d-tasks/issues/791 */
  /* overflow cannot be applied in Cocos2dGameContainer, 
  otherwise child elements will be hidden when Cocos2dGameContainer rotated 90 deg */
  overflow: hidden;
}

#Cocos2dGameContainer {
  position: absolute;
  margin: 0;
  left: 0px;
  top: 0px;

  display: -webkit-box;
  -webkit-box-orient: horizontal;
  -webkit-box-align: center;
  -webkit-box-pack: center;
}

canvas {
  background-color: rgba(0, 0, 0, 0);
}

a:link, a:visited {
  color: #666;
}

a:active, a:hover {
  color: #666;
}

p.header {
  font-size: small;
}

p.footer {
  font-size: x-small;
}

#splash {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: #171717 no-repeat center;
  background-size: 45%;
}

.progress-bar {
    position: absolute;
    left: 27.5%;
    top: 80%;
    height: 3px;
    padding: 2px;
    width: 45%;
    border-radius: 7px;
    box-shadow: 0 1px 5px #000 inset, 0 1px 0 #444;           
}

.progress-bar span {
    display: block;
    height: 100%;
    border-radius: 3px;
    transition: width .4s ease-in-out;
    background-color: #3dc5de;
}

.stripes span {
    background-size: 30px 30px;
    background-image: linear-gradient(135deg, rgba(255, 255, 255, .15) 25%, transparent 25%,
                        transparent 50%, rgba(255, 255, 255, .15) 50%, rgba(255, 255, 255, .15) 75%,
                        transparent 75%, transparent);            
    
    animation: animate-stripes 1s linear infinite;             
}

@keyframes animate-stripes {
    0% {background-position: 0 0;} 100% {background-position: 60px 0;}
}
</style></head>
<body>
  <canvas id="GameCanvas" oncontextmenu="event.preventDefault()" tabindex="0"></canvas>
  <div id="splash">
    <div class="progress-bar stripes">
      <span style="width: 0%"></span>
    </div>
  </div>

IDU_APP,\n                cc.sys.BROWSER_TYPE_WECHAT,\n                cc.sys.BROWSER_TYPE_MOBILE_QQ,\n                cc.sys.BROWSER_TYPE_MIUI,\n                cc.sys.BROWSER_TYPE_HUAWEI,\n                cc.sys.BROWSER_TYPE_UC,\n            ].indexOf(cc.sys.browserType) < 0);\n        }\n\n        // Limit downloading max concurrent task to 2,\n        // more tasks simultaneously may cause performance draw back on some android system / browsers.\n        // You can adjust the number based on your own test result, you have to set it before any loading process to take effect.\n        if (cc.sys.isBrowser && cc.sys.os === cc.sys.OS_ANDROID) {\n            cc.assetManager.downloader.maxConcurrency = 2;\n            cc.assetManager.downloader.maxRequestsPerFrame = 2;\n        }\n\n        var launchScene = settings.launchScene;\n        var bundle = cc.assetManager.bundles.find(function (b) {\n            return b.getSceneInfo(launchScene);\n        });\n        \n        bundle.loadScene(launchScene, null, onProgress,\n            function (err, scene) {\n                if (!err) {\n                    cc.director.runSceneImmediate(scene);\n                    if (cc.sys.isBrowser) {\n                        // show canvas\n                        var canvas = document.getElementById('GameCanvas');\n                        canvas.style.visibility = '';\n                        var div = document.getElementById('GameDiv');\n                        if (div) {\n                            div.style.backgroundImage = '';\n                        }\n                        console.log('Success to load scene: ' + launchScene);\n                    }\n                }\n            }\n        );\n\n    };\n\n    var option = {\n        id: 'GameCanvas',\n        debugMode: settings.debug ? cc.debug.DebugMode.INFO : cc.debug.DebugMode.ERROR,\n        showFPS: settings.debug,\n        frameRate: 60,\n        groupList: settings.groupList,\n        collisionMatrix: settings
